import React from "react";

function experience() {
  return (
    <>
      <div className="container d-flex flex-column">
        <h1>Skills!</h1>
        <div
          class="card"
          style={{
            width: "18rem",
          }}
        >
          <img
            class="card-img-top"
            src="https://www.tutorialrepublic.com/lib/images/html-illustration.png"
            alt=""
          />
          <div class="card-body">
            <p class="card-text">HTML</p>
          </div>
        </div>
        <div
          class="card"
          style={{
            width: "18rem",
          }}
        >
          <img class="card-img-top" src="..." alt="" />
          <div class="card-body">
            <p class="card-text">CSS</p>
          </div>
        </div>
        <div
          class="card"
          style={{
            width: "18rem",
          }}
        >
          <img class="card-img-top" src="..." alt="" />
          <div class="card-body">
            <p class="card-text">JS</p>
          </div>
        </div>
      </div>
    </>
  );
}

export default experience;
